import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <span>Fortnite Clicky Game</span>
      <img class="React" src="https://banner2.kisspng.com/20180518/ptw/kisspng-react-logo-javascript-front-and-back-ends-user-int-5afef575942028.3034008315266584216067.jpg" data-original="https://banner2.kisspng.com/20180518/ptw/kisspng-react-logo-javascript-front-and-back-ends-user-int-5afef575942028.3034008315266584216067.jpg"></img>
    </footer>
  );
}

export default Footer;
